function Footer(){
    return(
        <section id="footer" className="colored-section">

            <div className="container-fluid">
                <div className="footerIcones">
                <a class="footer-link" href="https://github.com/Sandalu2001"><img src="images/github-sign.png" alt="github"/></a>
                <a class="footer-link" href="https://www.linkedin.com/in/sandalu-de-silva/"><img src="images/linkedin.png" alt="linkedin"/></a>
                <a class="footer-link" href="https://www.facebook.com/profile.php?id=100010497852295"><img src="images/facebook.png" alt="facebook"/></a>
                <a class="footer-link" href="mailto:name@email.com"><img src="images/gmail.png" alt="mail"/></a>
                </div>

            </div>


        </section>
    )
}


